import styled from "styled-components";

const Container = styled.div`
    padding: 0px 20px;
`;

const Header = styled.header`
    height: 10vh;
    display: flex;
    justify-content: center;
    align-items: center;
`;

const CoinsList = styled.ul`

`;

const Coin = styled.li`
    background-color: #555555;
    color:${props => props.theme.bgColor};
    padding: 20px;
    border-radius: 10px;
    margin-bottom: 10px;
`;

const Title = styled.h1`
    font-size: 48px;
    color:${(props) => props.theme.accentColor};
`

const coins = [{
    id: "btc-bitcoin",
    name: "Bitcoin",
    symbol: "BTC",
    rank: 1,
    is_new: false,
    is_active: true,
    type: "coin",
},
{
    id: "eth-ethereum",
    name: "Ethereum",
    symbol: "ETH",
    rank: 2,
    is_new: false,
    is_active: true,
    type: "coin",
},
{
    id: "hex-hex",
    name: "HEX",
    symbol: "HEX",
    rank: 3,
    is_new: false,
    is_active: true,
    type: "token",
},]

function Coins() {
    return (
        <Container>
            <Header>
                <Title>Coins</Title>
            </Header>
            <CoinsList>
                {coins.map(coin => <Coin key={coin.id}>{coin.name} &rarr;</Coin>)}
            </CoinsList>
        </Container>
    )
}

export default Coins;
